import React, { Component } from 'react';


class Profile extends Component {
    constructor(props) {
        super(props);
    
        this.state = {
    //       user: null
    //       id: null,
          name: ''
    //       username: '',
    //       img: null,
    //       createdAt: "2020-07-08T16:34:23.861Z",
    //       email: null,
    //       City: null,
    //       Posts: []
        }
      }


    render() {
        return (
            <div>
            <h2>Profile Page</h2> 
            <h3>Name: {props.data.name} </h3>               
            </div>
            
     )
}
           
}

export default Profile;
